import React from 'react';
import Header from './Components/Header/header.js';
import Body from './Components/Body/body';
import Footer from './Components/Footer/Footer';
import './App.css';


function App() {
  return (
    <div className="App">
      <Header/>
      <Body/>
      <Footer/>
    </div>
  );
}

export default App;
